import "./navbar.css";
import { Route } from "react-router-dom";

const Home = () => <h1>Home</h1>;
const About = () => <h1>About</h1>;

const navbar = () => {
  return (
    <div>
      <div className="row">
        <div className="col">
          <Route path="/" component="{Home}" />
        </div>
        <div className="col">
          <button path="/signin">Login</button>
          <button>Logout</button>
        </div>
        <div className="col">
          <button>Register</button>
        </div>
      </div>
    </div>
  );
};

export default navbar;
